MAP_CITY_TO_CODE: dict[str:str] = {
    key: value
    for cities in cities_grouped_by_country.values()
    for key, value in cities.items()
}
ALLOWED_CITY: list[str] = list(MAP_CITY_TO_CODE.keys())
ALLOWED_CITY_CODE: list[str] = list(MAP_CITY_TO_CODE.values())
ALLOWED_COUNTRY_CODE: list[str] = list(cities_grouped_by_country.keys())

# Types
T_COUNTRY_CODE = Literal[*ALLOWED_COUNTRY_CODE]
T_CITY_CODE = Literal[*ALLOWED_CITY_CODE]
T_CITY = Literal[*ALLOWED_CITY]


def validate_city_code(city_code: str) -> None:
    if city_code not in ALLOWED_CITY_CODE:
        raise exceptions.SincproValidationError(
            f"Invalid city code: [{city_code}] allowed values: {ALLOWED_CITY_CODE}"
        )


def validate_country_code(country_code: str) -> None:
    if country_code not in ALLOWED_COUNTRY_CODE:
        raise exceptions.SincproValidationError(
            f"Invalid country code: [{country_code}] allowed values: {ALLOWED_COUNTRY_CODE}"
        )


def validate_city(city: str) -> None:
    city = city.capitalize()
    if city not in ALLOWED_CITY:
        raise exceptions.SincproValidationError(
            f"Invalid city: [{city}] allowed values: {ALLOWED_CITY}"
        )


CountryCode = new_value_object(NewType("CountryCode", str), validate_country_code)
CityCode = new_value_object(NewType("CityCode", str), validate_city_code)
CityName = new_value_object(NewType("CityName", str), validate_city)
